import { BiX } from "react-icons/bi";


const Sidebar = () => {
  return (
    <div className="w-[100vw] h-[100vh]  flex text-white font-sans fixed right-0 top-0">
      <div className="w-[65vw] h-[100vh] bg-zinc-800 text-white font-sans px-2">
        <div className="w-full flex items-center justify-end h-[50px] border-b border-slate-600">
          <BiX className="text-3xl" />
        </div>
      </div>
      <div className="w-[35vw] h-[100vh] bg-[rgba(0,0,0,0.4)]"></div>
    </div>
  );
}

export default Sidebar;
